import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";


const MainButton=()=>{
    return(
        <MainStyled>
        <div className="StartButton">
            <Link to="/main"><button className="StartButton">메인화면으로 가기</button></Link>
            페이지를 잘못 만들어버렸습니다.
        </div>
        </MainStyled>
    )
}

const MainStyled=styled.div`
.StartButton {
    border: none;
    border-radius: 35px;
    color: var(--text);
    background-color: var(--sub1);
    font-size: 15px;
    width: 200px;
    height: 60px;
    font-family: 'Noto Serif Korean';
    cursor: pointer;
}
.StartButton:hover{
    border: none;
    border-radius: 35px;
    color: var(--sub2);;
    background-color: transparent;
    font-size: 35px;
    width: 200px;
    height: 60px;
    font-family: 'Noto Serif Korean';
}
`;
export default MainButton;
